def merge_sort(theArray):
	if len(theArray) > 1:
		n = len(theArray)
		if n%2 == 0:
			m = n/2
		else:
			m = (n/2)+1
		# divide the array in half
		left = merge_sort(theArray[0:m])
		right = merge_sort(theArray[m:n])
		return merge(left,right)
	else:
		return theArray

def merge(left,right):
	# initalize some variables
	# index of the left array
	l = 0
	# index of the right array
	r = 0
	# index in the new array
	k = 0
	newArray = []
	while l < len(left) and r < len(right):
		if left[l] < right[r]:
			newArray.append(left[l])
			l = l + 1
		elif left[l] > right[r]:
			newArray.append(right[r])
			r = r + 1
		k = k+1

	while l < len(left):
		newArray.append(left[l])
		l = l + 1
	while r < len(right):
		newArray.append(right[r])
		r = r + 1	
	return newArray


